import React from "react";
import "./predic.css";
import { useState, useEffect } from "react";
import { fetchDataPost } from "../../controler/comunicacao";
import DropdownToolTip from "../../components/Dropdown/DropdownToolTip";
import Modal from "../../components/Modal/Modal";
import LoadingAnimation from "../../components/LoadingAnimation/LoadingAnimation";

export default function PredicNotif() {
  const [flag, setFlag] = useState(false);
  const [data, setData] = useState();
  const [selectedTipo, setSelectedTipo] = useState("Negativo");
  const [selectedSexo, setSelectedSexo] = useState([]);
  const [loading, setloading] = useState(true);
  const [aplicar, setAplicar] = useState(true);


  const handleSexoSelect = (sexo) => {
    if (sexo === "Todos") {
      setSelectedSexo([]);
    } else if (selectedSexo.length === 0) {
      setSelectedSexo([sexo]);
    } else if (selectedSexo.length === 1 && selectedSexo[0] === sexo) {
      setSelectedSexo([]); // Desmarca o sexo selecionado
    } else {
      setSelectedSexo([sexo]);
    }
  };

  useEffect(() => {
    setloading(true);
    const params = {
      doenca: "TU",
      SexoPaciente: selectedSexo,
      HIV: selectedTipo,
    };
    Promise.all([fetchDataPost("/tuberculose/predicao/CASOS", params)])
      .then(([data]) => {
        if (data !== undefined) {
          setData(data);
        }
      })
      .finally(setloading(false));
  }, []);

  const handleAplicar = () => {
    setSelectedMapa(tempSelectedMapa);
    setAplicar(!aplicar);
  };

  return (
    <section className="maps">
      {/* TITULO */}

      <div className="row mb-3">
        <div className="col-12">
          <div className="titulo p-3 d-flex justify-content-between align-items-center">
            <div className="titulo-nome">Mapas de Notificações</div>
            <div className="filter-button" onClick={() => setFlag(!flag)}>
              Filtros
            </div>
          </div>
        </div>
      </div>

      {/* FILTROS */}

      <div className={"on " + (flag ? "show mb-3" : "hide mb-0")}>
        <div className="row on-content">
          <div className="col-12">
            <div className="titulo p-3">
              <div className="filtros-wrapper">
                <div className="filtros mb-3">
                  {/* SELECT DE DOENÇA */}

                  <div className="filtro pe-3">
                    <div className="card">
                      <div className="card-header d-flex justify-content-between align-items-center">
                        <h5 className="m-0">Tipo</h5>
                        <DropdownToolTip>escrever coisa aqui</DropdownToolTip>
                      </div>
                      <div className="card-body">
                        <div className="form-check">
                          <div className="">
                            <input
                              type="checkbox"
                              id="tipo-TB"
                              value="TB"
                              className="form-check-input"
                              checked={selectedTipo === "Negativo"}
                              onChange={() => setSelectedTipo("Negativo")}
                            />
                            <label
                              htmlFor="tipo-TB"
                              className="form-check-label"
                            >
                              Tuberculose
                            </label>
                          </div>

                          <div className="">
                            <input
                              type="checkbox"
                              id="tipo-TB-HIV"
                              value="TB-HIV"
                              className="form-check-input"
                              checked={selectedTipo === "Positivo"}
                              onChange={() => setSelectedTipo("Positivo")}
                            />
                            <label
                              htmlFor="tipo-TB-HIV"
                              className="form-check-label"
                            >
                              Tuberculose + HIV
                            </label>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>

                  {/* SELECT DE GENERO */}

                  <div className="filtro pe-3">
                    <div className="card">
                      <div className="card-header d-flex justify-content-between align-items-center">
                        <h5 className="m-0">Escolha o Gênero</h5>
                        <DropdownToolTip>
                          <p className="mb-2">
                            Selecione um ou mais gêneros para filtrar os dados apresentados.
                          </p>
                          <p className="mb-0">
                            Caso nenhum gênero seja selecionado, os dados exibidos incluirão todos os gêneros.
                          </p>
                        </DropdownToolTip>
                      </div>
                      <div className="card-body">
                        <div className="form-check">
                          <input
                            type="checkbox"
                            id="sexo-ambos"
                            value="Todos"
                            className="form-check-input"
                            checked={selectedSexo.length === 0}
                            onChange={() => handleSexoSelect("Todos")}
                          />
                          <label
                            htmlFor="sexo-ambos"
                            className="form-check-label"
                          >
                            TODOS
                          </label>

                          <div className="">
                            <input
                              type="checkbox"
                              id="sexo-masculino"
                              value="M"
                              className="form-check-input"
                              checked={selectedSexo.includes("M")}
                              onChange={() => handleSexoSelect("M")}
                            />
                            <label
                              htmlFor="sexo-masculino"
                              className="form-check-label"
                            >
                              Masculino
                            </label>
                          </div>
                          <div className="">
                            <input
                              type="checkbox"
                              id="sexo-feminino"
                              value="F"
                              className="form-check-input"
                              checked={selectedSexo.includes("F")}
                              onChange={() => handleSexoSelect("F")}
                            />
                            <label
                              htmlFor="sexo-feminino"
                              className="form-check-label"
                            >
                              Feminino
                            </label>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>

                </div>
              </div>
              <button
                className="filter-button mt-3"
                onClick={() => handleAplicar()}
              >
                Aplicar
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* CARD MAPA */}
      <div className="col-12 mb-3">
        <div className="card">
          <div className="card-header d-flex justify-content-between align-items-center">
            <h5 className="m-0">Predição Sobre as Notificações de Tuberculose</h5>
            <div className="d-inline-flex align-items-center">
              <DropdownToolTip>
                <p>Mapas dos casos notificados no Estado de Mato Grosso.</p>
                <p>
                  Alterne entre os mapas de Incidencia, de calor, de cluster e
                  de Moran(não pode ser filtrado por ano).
                </p>
                <p className="m-0">
                  Os mapas são filtrados apenas por UM ano especifico.
                </p>
              </DropdownToolTip>

              <Modal title="Predição Sobre as Notificações de Tuberculose" id="ModalMap">
                <iframe
                  srcDoc={mapa}
                  title="Mapa Tuberculose"
                  width="100%"
                  height="100%"
                  className="map-container"
                />
              </Modal>
            </div>
          </div>
          <div className="card-body p-0 a">
            {loading === true ? (
              <LoadingAnimation />
            ) : (
              <iframe
                srcDoc={data}
                title="Mapa Tuberculose"
                width="100%"
                height="100%"
                className="map-container"
              />
            )}
          </div>
        </div>
      </div>
    </section>
  );
}
